import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomForm } from '../Model/Interface';

const host = 'localhost:3001';
interface Props {
    speedSlalomRecords: SpeedSlalomForm[];
}

const SpeedSlalomRecordTable = () => {
    const [SSRecords, setSSRecords] = useState<SpeedSlalomForm[]>([]);
    const [athletesData, setAthletesData] = useState<any>({});
  
    useEffect(() => {
      axios.get(`http://${host}/api/getSSRecord`)
        .then(response => {
            setSSRecords(response.data);
        })
        .catch(error => {
          console.error(error);
        });
    }, []);

    return (
        <div>

        </div>
    );
};

export default SpeedSlalomRecordTable;
